The `markerClass` is set to `any`, so I can use `L.Marker`, but the `markerStyle` is set to use `PathOptions` only.

Changing the `markerStyle` to `any`, assuming that the markerClass could also be `L.Icon`, etc.

Example usage:

```
// marker styles
  markerStyles = {
    current: L.divIcon({
      className: 'leaflet-current'
    })
  };

    // add the locate control to the map
    L.control
      .locate({
        icon: 'leaflet-control-locate-icon',
        iconLoading: 'leaflet-control-locate-icon-loader spin',
        drawCircle: false, // set to true to show accuracy ring
        showPopup: false,
        markerClass: L.marker,
        markerStyle: {
          icon: this.markerStyles.current
        }
      })
      .addTo(this._map);
  }

```

